import React from "react";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import Home from "../screens/Home";
import InputNama from "../screens/InputNama";
import Quiz from "../screens/Game/indonesiaTimur/Quiz";
import MateriMenu from "../screens/MateriMenu";
import About from "../screens/About";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import MaterialCommunityIcons from "react-native-vector-icons/MaterialCommunityIcons";
import { COLORS } from "../constants";
import MateriSatu from "../screens/materi/MateriSatu";
import MateriDua from "../screens/materi/MateriDua";
import MateriTiga from "../screens/materi/MateriTiga";
import Instruction from "../screens/Instruction";
import MenuQuiz from "../screens/GameMenu/MenuQuiz";
import ModelQuiz from "../screens/GameMenu/indonesiaTimur/ModelQuiz";
import TebakGambar from "../screens/Game/indonesiaTimur/TebakGambar";
import ModelQuizT from "../screens/GameMenu/indonesiaTengah/ModelQuizT";
import ModelQuizB from "../screens/GameMenu/indonesiaBarat/ModelQuizB";
import Essay from "../screens/Game/indonesiaTimur/Essay";
import QuizTengah from "../screens/Game/indonesiaTengah/QuizTengah";
import TebakGambarTengah from "../screens/Game/indonesiaTengah/TebakGambarTengah";
const Stack = createNativeStackNavigator();

function MyStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Main" component={TabNav} options={{ headerShown: false }} />
      <Stack.Screen
        name="Quiz"
        component={Quiz}
        options={{
          title: "Quiz",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="MateriMenu"
        component={MateriMenu}
        options={{
          headerShown: true,
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="MateriSatu"
        component={MateriSatu}
        options={{
          title: "Materi 1",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="MateriDua"
        component={MateriDua}
        options={{
          title: "Materi 2",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="MateriTiga"
        component={MateriTiga}
        options={{
          title: "Materi 3",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="Instruction"
        component={Instruction}
        options={{
          title: "Petunjuk",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="MenuQuiz"
        component={MenuQuiz}
        options={{
          title: "Menu Quiz",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="TebakGambar"
        component={TebakGambar}
        options={{
          title: "Model Quiz",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="ModelQuiz"
        component={ModelQuiz}
        options={{
          title: "Model Quiz",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="ModelQuizT"
        component={ModelQuizT}
        options={{
          title: "Model Quiz",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="ModelQuizB"
        component={ModelQuizB}
        options={{
          title: "Model Quiz",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="Essay"
        component={Essay}
        options={{
          title: "Essay",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="QuizTengah"
        component={QuizTengah}
        options={{
          title: "Essay",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      <Stack.Screen
        name="TebakGambarTengah"
        component={TebakGambarTengah}
        options={{
          title: "Essay",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      />
      {/* <Stack.Screen
        name="MenuQuiz"
        component={MenuQuiz}
        options={{
          title: "Essay",
          headerStyle: {
            backgroundColor: COLORS.primary,
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
        }}
      /> */}
    </Stack.Navigator>
  );
}
export default MyStack;

const Tab = createBottomTabNavigator();

function TabNav() {
  return (
    <Tab.Navigator
      initialRouteName="Feed"
      screenOptions={{
        tabBarActiveTintColor: COLORS.secondary,
      }}
    >
      <Tab.Screen
        name="Home"
        component={Home}
        options={{
          tabBarLabel: "Home",
          tabBarIcon: ({ color, size }) => <MaterialCommunityIcons name="home" color={COLORS.primary} size={size + 5} />,
          headerShown: false,
        }}
      />
      {/* <Tab.Screen
        name="Materi"
        component={MateriMenu}
        options={{
          tabBarLabel: "Instruction",
          tabBarIcon: ({ color, size }) => <MaterialCommunityIcons name="newspaper-variant-multiple" color={COLORS.primary} size={size} />,
          // tabBarBadge: 3,
          headerShown: false,
        }}
      /> */}
      <Tab.Screen
        name="About"
        component={Home}
        options={{
          tabBarLabel: "About",
          tabBarIcon: ({ color, size }) => <MaterialCommunityIcons name="account" color={COLORS.primary} size={size} />,
          headerShown: false,
        }}
      />
    </Tab.Navigator>
  );
}
